void unifi_nme_scan_full_req(FsmContext* context,
                             void* appHandle,
                             CsrUint8 ssidCount,
                             const unifi_SSID *ssid,
                             const unifi_MACAddress *bssid,
                             CsrBool forceScan,
                             unifi_BSSType bssType,
                             unifi_ScanType scanType,
                             CsrUint16 channelListCount,
                             const CsrUint8 *channelList,
                             CsrUint16 probeIeLength,
                             const CsrUint8 *probeIe)
{
    UnifiNmeScanFullReq_Evt* evt = (UnifiNmeScanFullReq_Evt*)CsrPmalloc(sizeof(UnifiNmeScanFullReq_Evt));

    INIT_EVENT_HEADER(evt, UNIFI_NME_SCAN_FULL_REQ_ID);

    evt->appHandle = appHandle;
    evt->ssidCount = ssidCount;
    evt->ssid = NULL;
    if (ssidCount)
    {
        CsrUint16 i1;
        evt->ssid = (unifi_SSID*)CsrPmalloc(sizeof(unifi_SSID) * ssidCount);
        for(i1 = 0; i1 < ssidCount; i1++)
        {
            CsrMemCpy(evt->ssid[i1].ssid, ssid[i1].ssid, 32);
            evt->ssid[i1].length = ssid[i1].length;
        }
    }
    CsrMemCpy(evt->bssid.data, bssid->data, 6);
    evt->forceScan = forceScan;
    evt->bssType = bssType;
    evt->scanType = scanType;
    evt->channelListCount = channelListCount;
    evt->channelList = NULL;
    if (channelListCount)
    {
        evt->channelList = (CsrUint8*)CsrPmalloc(channelListCount);
        CsrMemCpy(evt->channelList, channelList, channelListCount);
    }
    evt->probeIeLength = probeIeLength;
    evt->probeIe = NULL;
    if (probeIeLength)
    {
        evt->probeIe = (CsrUint8*)CsrPmalloc(probeIeLength);
        CsrMemCpy(evt->probeIe, probeIe, probeIeLength);
    }

    fsm_send_event_external(context, (FsmEvent*)evt, getNmeContext(context)->nmeSignalRoutingFsmInstance, evt->common.id);
}

